import React, { memo, useState } from 'react';

const Son = memo(function () {
  console.log('son 组件 render.....');
  return (
    <div>
      <h1>Son组件</h1>
    </div>
  );
});
export default function App() {
  const [count, setCount] = useState(0);
  return (
    <div>
      <Son />
      <button onClick={() => setCount(count + 1)}>count:{count}</button>
    </div>
  );
}
